<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <title>MSP2 LoveIt</title>
  <style>
    body {
      font-family: 'Segoe UI', Tahoma, Geneva, Verdana, sans-serif;
      background: #0f172a;
      color: white;
      display: flex;
      justify-content: center;
      align-items: center;
      height: 100vh;
      margin: 0;
      padding: 0;
      overflow: hidden;
    }

    .panel {
      background: linear-gradient(145deg, rgba(30, 41, 59, 0.9), rgba(60, 80, 100, 0.9));
      padding: 15px;
      border-radius: 20px;
      width: 350px;
      box-shadow: 0 8px 16px rgba(0, 0, 0, 0.3);
      animation: growPanel 1s ease-out forwards;
      margin-bottom: 30px;
      zoom: 0.83;
      position: relative;
      top: -35px;
    }

    @keyframes growPanel {
      0% {
        opacity: 0;
        transform: scale(0);
      }
      100% {
        opacity: 1;
        transform: scale(1);
      }
    }

    .panel h2 {
      margin-top: 0;
      text-align: center;
      font-size: 28px;
      font-weight: bold;
      background: linear-gradient(45deg, #34d399, #a855f7, #93c5fd);
      background-clip: text;
      -webkit-background-clip: text;
      color: transparent;
      text-shadow: 2px 2px 8px rgba(0, 0, 0, 0.7);
      margin-bottom: 15px;
    }

    .made-by {
      font-size: 12px;
      text-align: center;
      color: white;
      margin-top: 5px;
      background: linear-gradient(45deg, #ffffff, #ffffff, #ffffff);
      background-clip: text;
      -webkit-background-clip: text;
      color: transparent;
      font-weight: bold;
    }

    input, select, button {
      width: 100%;
      margin: 10px 0;
      padding: 10px;
      border: none;
      border-radius: 10px;
      box-sizing: border-box;
      transition: all 0.3s ease;
    }

    input, select {
      background: rgba(255, 255, 255, 0.1); 
      color: white;
      font-size: 16px;
    }

    select {
      background: rgba(255, 255, 255, 0.3); 
      color: white;
    }

    select option {
      background-color: rgba(255, 255, 255, 0.9);
      color: black;
    }

    button {
      cursor: pointer;
      color: white;
      font-size: 16px;
      box-shadow: 0 4px 8px rgba(0, 0, 0, 0.3);
      transition: all 0.3s ease;
    }

    .btn-green { 
      background: linear-gradient(45deg, #34d399, #16a34a);
    }
    .btn-blue { 
      background: linear-gradient(45deg, #1d4ed8, #3b82f6);
    }
    .btn-red { 
      background: linear-gradient(45deg, #dc2626, #f87171);
    }
    .btn-gray { 
      background: linear-gradient(45deg, #334155, #475569);
    }
    .btn-yellow { 
      background: linear-gradient(45deg, #facc15, #fbbf24);
    }

    button:hover {
      transform: scale(1.05);
      box-shadow: 0 10px 20px rgba(0, 0, 0, 0.4);
    }

    button:active {
      transform: scale(1.02);
      box-shadow: 0 4px 8px rgba(0, 0, 0, 0.5);
    }

    .status {
      margin-top: 10px;
      text-align: center;
    }

    .footer {
      position: fixed;
      bottom: 10px;
      left: 50%;
      transform: translateX(-50%);
      font-size: 14px;
      color: white;
      background-color: rgba(0, 0, 0, 0.5);
      padding: 10px;
      border-radius: 10px;
      width: 80%;
      text-align: center;
    }

    .warning {
      color: #facc15;
      font-weight: bold;
    }

    .warning-title {
      font-size: 16px;
      margin-bottom: 10px;
    }

    .warning-title::before {
      content: "⚠️ ";
      font-size: 20px;
    }
  </style>
</head>
<body>
  <div class="panel">
    <h2>MSP2 LoveIt</h2>
    <div class="made-by">
      Made by: msp test 01 • 
      <a href="https://files.fm/f/7vn8hmfvcf" target="_blank" style="color: #93c5fd; text-decoration: none; font-weight: bold;">
        Tutorial
      </a>
    </div>

    <label>Manual ID</label>
    <input type="text" id="manualIdInput" placeholder="Enter ID...">
    <button class="btn-green" id="addManualIdButton">➕ Add ID</button>

    <label>LoveIt Count</label>
    <select id="selectCount">
      <option value="25">25</option>
      <option value="50">50</option>
      <option value="75">75</option>
      <option value="100">100</option>
    </select>

    <label>Speed</label>
    <select id="speedSelect">
      <option value="1">1 (1000ms)</option>
      <option value="5">5 (500ms)</option>
      <option value="10">10 (100ms)</option>
    </select>

    <button class="btn-blue" id="startButton">Start</button>
    <button class="btn-red" id="deleteLoveitButton">Delete LoveIt</button>
    <button class="btn-red" id="clearSavedIdsButton">Clear ID</button>
    <button class="btn-gray" id="toggleViewsButton">Views: OFF</button>

    <div class="status" id="statusText"></div>
    <div class="status" id="counterText"></div>
    <div class="status" id="savedIdsText">Saved IDs: 0</div>
  </div>

  <div class="footer">
    <div class="warning-title">Warning!</div>
    <span class="warning">This tool is extremely sensitive and if detected by msp, your account can be permanently banned.</span>
  </div>
